import React, { useState } from "react";
import { HCardBuilderLayout } from "./styled";
import { HCardForm } from "components/HCardForm";
import { HCardView } from "components/HCardView";
import { HCardState } from "common/types";

export const HCardBuilder = () => {
  const initialState = {
    givenName: "",
    surname: "",
    email: "",
    phone: "",
    houseNameOrNumber: "",
    street: "",
    suburb: "",
    state: "",
    postcode: "",
    country: "",
  };

  const [hCardState, setHCardState] = useState<HCardState>(initialState);

  return (
    <HCardBuilderLayout>
      <HCardForm {...hCardState} />
      <HCardView />
    </HCardBuilderLayout>
  );
};
